{"id": 278222726, "url": "https://api.github.com/repos/numpy/numpy/issues/10138", "body": "The case is illustrated below:
In "_safe_ceil_to_intp":
    ivalue = npy_ceil(value);   <= ivalue is NaN when value is NaN.
    if (ivalue < NPY_MIN_INTP || ivalue > NPY_MAX_INTP) {
        return -1;  <= this is never executed when ivalue is NaN.
    }

    *ret = (npy_intp)ivalue;  <= this is undefined behavior when ivalue is NaN.", "user": {"id": 18222402, "url": "https://api.github.com/users/shenhanc78", "type": "User", "login": "shenhanc78", "node_id": "MDQ6VXNlcjE4MjIyNDAy", "html_url": "https://github.com/shenhanc78", "gists_url": "https://api.github.com/users/shenhanc78/gists{/gist_id}", "repos_url": "https://api.github.com/users/shenhanc78/repos", "avatar_url": "https://avatars.githubusercontent.com/u/18222402?v=4", "events_url": "https://api.github.com/users/shenhanc78/events{/privacy}", "site_admin": false, "gravatar_id": "", "starred_url": "https://api.github.com/users/shenhanc78/starred{/owner}{/repo}", "followers_url": "https://api.github.com/users/shenhanc78/followers", "following_url": "https://api.github.com/users/shenhanc78/following{/other_user}", "organizations_url": "https://api.github.com/users/shenhanc78/orgs", "subscriptions_url": "https://api.github.com/users/shenhanc78/subscriptions", "received_events_url": "https://api.github.com/users/shenhanc78/received_events"}, "state": "closed", "title": "BUG: Fix corner cases when value is NaN.", "labels": [{"id": 6359214, "url": "https://api.github.com/repos/numpy/numpy/labels/00%20-%20Bug", "name": "00 - Bug", "color": "fef2c0", "default": false, "node_id": "MDU6TGFiZWw2MzU5MjE0", "description": null}, {"id": 771819533, "url": "https://api.github.com/repos/numpy/numpy/labels/59%20-%20Needs%20tests", "name": "59 - Needs tests", "color": "207de5", "default": false, "node_id": "MDU6TGFiZWw3NzE4MTk1MzM=", "description": null}], "locked": false, "number": 10138, "node_id": "MDExOlB1bGxSZXF1ZXN0MTU1Njg0NDIz", "assignee": null, "comments": 13, "html_url": "https://github.com/numpy/numpy/pull/10138", "assignees": [], "closed_at": "2017-12-12T04:35:26Z", "milestone": null, "reactions": {"+1": 0, "-1": 0, "url": "https://api.github.com/repos/numpy/numpy/issues/10138/reactions", "eyes": 0, "heart": 0, "laugh": 0, "hooray": 0, "rocket": 0, "confused": 0, "tota