{"id": 55622787, "url": "https://api.github.com/repos/numpy/numpy/issues/5509", "body": "This is a follow on to our discussion in #5420, about adding sum_abs and max_abs ufuncs.  Testing here show this version to be almost as fast as a raw maximum.reduce for float64 and float32.  In both the SIMD loop and the BINARY_REDUCE_LOOP paths.

Still needs tests.
