{"id": 339170982, "url": "https://api.github.com/repos/numpy/numpy/issues/11526", "body": "Adds helper functions for the copy->view transition for multi-field indexes. Adds `structured_to_unstructured`, `apply_along_fields`, `assign_fields_by_name`, `require_fields`.

This is based on the feedback from discussions on the mailing list and on github about cases where users wanted the "old" behavior. See https://github.com/numpy/numpy/pull/6053#issuecomment-383089812,  and this mailing list thread: http://numpy-discussion.10968.n7.nabble.com/Setting-custom-dtypes-and-1-14-tt45156.html#a45207. Note the reply there arguing we should skip `apply_along_fields`, maybe we should remove that one.

Don't merge yet. I'd like to let this sit a while in case there are more ideas for useful functions.  Putting it up now so everyone can get a sense of what is being proposed.", "user": {"id": 9040124, "url": "https://api.github.com/users/ahaldane", "type": "User", "login": "ahaldane", "node_id": "MDQ6VXNlcjkwNDAxMjQ=", "html_url": "https://github.com/ahaldane", "gists_url": "https://api.github.com/users/ahaldane/gists{/gist_id}", "repos_url": "https://api.github.com/users/ahaldane/repos", "avatar_url": "https://avatars.githubusercontent.com/u/9040124?v=4", "events_url": "https://api.github.com/users/ahaldane/events{/privacy}", "site_admin": false, "gravatar_id": "", "starred_url": "https://api.github.com/users/ahaldane/starred{/owner}{/repo}", "followers_url": "https://api.github.com/users/ahaldane/followers", "following_url": "https://api.github.com/users/ahaldane/following{/other_user}", "organizations_url": "https://api.github.com/users/ahaldane/orgs", "subscriptions_url": "https://api.github.com/users/ahaldane/subscriptions", "received_events_url": "https://api.github.com/users/ahaldane/received_events"}, "state": "closed", "title": "ENH: add multi-field assignment helpers in np.lib.recfunctions", "labels": [{"id": 6359239, "url": "https://api.github.com/repos/numpy/numpy/labels/01%20-%20Enhancement", "name": "01 - Enhancement", "color": "fef2c0", "default": false, "node_id": "MDU6TGFiZWw2MzU5MjM5", "description": null}, {"id": 16917082, "url": "https://api.github.com/repos/numpy/numpy/labels/component:%20numpy.lib", "name": "component: numpy.lib", "color": "009800", "default": false, "node_id": "MDU6TGFiZWwxNjkxNzA4Mg==", "description": null}, {"id": 325755452, "url": "https://api.github.com/repos/numpy/numpy/labels/56%20-%20Needs%20Release%20Note.", "name": "56 - Needs Release Note.", "color": "207de5", "default": false, "node_id": "MDU6TGFiZWwzMjU3NTU0NTI=", "description": "Needs an entry in doc/release/upcoming_changes"}, {"id": 987701410, "url": "https://ap